  false,\n\t\"url\": null,\n\t\"notes\": \"CPD Maps includes data on the locations
  of existing CDBG, HOME, public housing and other HUD-funded community assets, so
  that users can view past investments geographically when considering various strategies
  for future funding. CPD Maps offers a large amount of data in a way that is easy
  to access. The website allows grantees and the general public to easily search,
  query, and display information to identify trends and analyze the needs of their
  community.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
